import ItemCard from "./ItemCard";
import {IItems} from "../controller/homeController";
import {FormEvent} from "react";

export type addItemsFunc = (event: FormEvent<HTMLFormElement> | IItem) => void
export type removeItemsFunc = (item: IItem) =>void

const mapItemCards: (item: IItem, index: number) => JSX.Element = (item: IItem, index: number, add: addItemsFunc, remove: removeItemsFunc) => {
    return <ItemCard item={item} key={index} add={props.add} remove={props.remove} decrease={props.decrease}/>
}

export default function Items(props: ItemsProps) {
    return (
        <div>
            {Object.entries(props.items!)
                .map((item, index) => mapItemToCards(item, index, props.add, props.remove))
            }
        </div>
    )
}
